import React, { Component } from 'react'
import { BrowserRouter as Router, Link } from 'react-router-dom';
import './Header.css';

export default class Header extends Component {
    render() {
        return (
            <header>
                <Router>
                    <Link to="/receta">Receta</Link>
                    <Link to="/agregar">Agregar Receta</Link>
                </Router>
            </header>
        )
    }
}
